from typing import List
from functools import cache, lru_cache

class Solution:
    def maxScore(self, a: List[int], b: List[int]) -> int:
        
        @lru_cache()
        def dfs(i, j):
            if i == len(a):
                return 0

            if j == len(b):
                return float('-inf')

            return max(
                dfs(i + 1, j + 1) + a[i] * b[j],  # pick
                dfs(i, j + 1),                    # not pick
            )

        return dfs(0, 0)

